import React from 'react';
import Rating from 'react-rating';

const ImgCard = ({ className, imgPath, preVerify, ratingValue, location, reviews }) => {
  return (
    <div className={className}>
      <img src={imgPath} height="50%" width="100%" alt=""/>
      <div className="Details">
        <div className="PersonalDetail">
          Jhon Smith
          {preVerify &&
            <img src="/images/PreVerify.svg" height="10%" width="30%" alt=""/>
          }
        </div>
        <div className="Rating">
          <Rating
            readonly={false}
            initialRating={ratingValue}
            emptySymbol={<img src="/images/empty-star.svg" alt='Empty Rating Star' />}
            fullSymbol={<img src="/images/full-star.svg" alt='Full Rating Star' />}
          />
          <div className="text-right">jhbj</div>
        </div>
        <div className="Location">
          <img src="/images/location_icon.svg" className="imageLocation" alt="" />
          {location && location}
        </div>
      </div>
    </div>
  );
};

export default ImgCard;
